const imageStyle = {
  width: '150px',
  height: 'auto',
};

class App extends Component {
  render() {
    return (
      <div className="App">
        <ImagePreload
          src={s3URL}
          imageStyle={imageStyle}
          initialComponent={Component1}
          preloadComponent={Component2}
        />

        <ImagePreload
          src={s3URL2}
          imageStyle={imageStyle}
          initialComponent={Component1}
          preloadComponent={Component2}
        />

        <ImagePreload
          src={base64}
          imageStyle={imageStyle}
          initialComponent={Component1}
          preloadComponent={Component2}
        />
      </div>
    );
  }
}

export default App;
